import React from "react";
import "./NavBar.css";
import { Link } from "react-router-dom";

const NavBar = () => {
  return (
    <div className="main">
      <label id="hamburger-menu">
  <nav id="sidebar-menu">
    <h3>Menu</h3>
    <ul>
      <li><a href="#">Home</a></li>
      <li><a href="#">Store</a></li>
      <li><a href="#">Blog</a></li>
      <li><a href="#">About</a></li>
      <li><a href="#">Contact</a></li>
    </ul>
  </nav>
</label>

<div class="overlay"></div>
      <Link to="/home">
        <img className="logo" src="./images/Twenteefore - Logo 2.png" />
      </Link>
      <nav className="navbar">
          {" "}
          <Link className="homeLink" to="/">
            Home
          </Link>
          <Link className="orderLink" to="/">
            Order
          </Link>
          <Link className="leaderboardsLink" to="/">
            Leaderboards
          </Link>
          {" "}
          <Link className="marketplaceLink" to="/">
            Marketplace
          </Link>
        {/* </li> */}
        {/* <li className="li"> */}
          {" "}
          <Link className="faqsLink" to="/faqs">
            FAQs
          </Link>
        {/* </li> */}
      </nav>
      <Link className="loginLink" to="/login">
        <button id="loginLink">Log In</button>
      </Link>
    </div>
  );
};
export default NavBar;
